intro:
Vợ chồng mình 38 – 43 tuổi, là tầng lớp trí thức, sống gần khu vực Dĩ An, Thủ Đức.

Cần tìm bạn nam như sau:

1. Tuổi từ 25 - 35;

2. Nói chuyện lịch sự, nhã nhặn, tôn trọng quyền riêng tư, tôn trọng phụ nữ;

3. Hàng có thể không dài, nhưng phải TO;

4. Không: xăm trổ, hút thuốc, rượu bia, chất kích thích, ma túy, đập đá, hôi miệng, hôi nách, mùi hôi cơ thể, bệnh truyền nhiễm.

5. Có kĩ năng bú, liếm, làm tình, chiều chuộng phụ nữ và quan trọng phải dai sức, làm tình trên 15 phút không kể thời gian vuốt ve bên ngoài.

Nếu bạn cảm thấy phù hợp thì inbox mình số zalo và vài dòng giới thiệu thông tin cá nhân của bạn như năm sinh, cao, quan điểm some của bạn (như là nhẹ nhàng tình cảm, hay là mạnh mẽ chẳng hạn).

Do vợ chồng mình giao thiệp rộng, để tránh gặp người quen nên mình cần xem hình ảnh thật của người đăng ký (không che mặt), cảm thấy an toàn thì mình mới tiến tới được. Các bạn thông cảm, tất nhiên mình cũng đảm bảo sẽ giữ bí mật thông tin của bạn.
